__NUXT_JSONP__("/svet/stat/guinea-bissau/elektricke-zasuvky", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s){return {data:[{tabsLoad:{tabWhatToSee:c,tabPrice:c,tabPeople:c,tabTrip:c,tabContact:c,tabHotel:c,tabNeighboring:j,tabVideos:d,tabArticles:d,tabWallSockets:k,tabChains:d,tabFauna:k,tabFlora:d,tabFoods:d,tabBrands:d},place:[{tld:".gw",name:"Guinea-Bissau",area:36125,population:1874309,slug:l,id_continent:e,information_chatgpt:"\u003Cp\u003EGuinea-Bissau je země ležící v západní Africe, která je známá svými tropickými plážemi, národními parky a kulturními tradicemi. Má rozlohu asi 36 000 km² a přibližně 1,9 milionu obyvatel.\u003C\u002Fp\u003E\n\u003Cp\u003EZemě je domovem mnoha etnických skupin, včetně Fula, Mandinga, Balanta a Pepel. Kromě toho zde hovoří několik jazyků, jako je portugalština (oficiální jazyk), kreolština a různé místní jazyky. Guinea-Bissau se nachází v oblasti tzv. Guinejského zálivu, kde je mnoho národních parků, které jsou domovem pro různé druhy zvířat, jako jsou sloni, lvi, gorily a šimpanzi.\u003C\u002Fp\u003E\n\u003Cp\u003EMezi hlavní turistické atrakce v zemi patří Národní park Orango, který se skládá z několika ostrůvků v deltě řeky Geba. Zde mohou turisté sledovat krokodýly, ryby a ptáky v jejich přirozeném prostředí. Dalšími zajímavými místy jsou Bijagóské ostrovy, které jsou souostrovím 88 ostrovů s nádhernými plážemi, křišťálově čistou vodou a místními tradicemi a rituály. Na pevninské části země se nachází mnoho dalších přírodních parků a chráněných oblastí, jako je Národní park Dulombi a Národní park João Vieira e Poilão.\u003C\u002Fp\u003E\n\u003Cp\u003EKromě toho je Guinea-Bissau také bohatá na kulturní dědictví. Mnoho lidí zde stále dodržuje tradiční rituály a zvyky, jako je tanec a hudba, které jsou často spojené s náboženstvím a přírodou. Nejznámějším festivalem v zemi je Festa de Tabanka, který se koná každoročně v srpnu, a je oslavou kulturní identity a dědictví Guiney-Bissau.\u003C\u002Fp\u003E\n\u003Cp\u003ENavzdory svým turistickým a kulturním bohatstvím má Guinea-Bissau stále řadu výzev, jako je chudoba, korupce a nedostatečná infrastruktura. Nicméně, pro turisty, kteří chtějí objevovat unikátní a autentickou část Afriky, může být Guinea-Bissau zajímavou destinací.\u003C\u002Fp\u003E",money_prices:[{name:"Taxi (cena za km)",value:h,date_update:a},{name:"Hlavní jídlo",value:1500,date_update:a},{name:"Chleba",value:m,date_update:a},{name:"Mléko",value:200,date_update:a},{name:"Voda (500ml)",value:m,date_update:a},{name:"Espresso",value:400,date_update:a},{name:"Zmrzlina (jeden kopeček)",value:h,date_update:a},{name:"Pivo",value:1000,date_update:a},{name:"Krabička cigaret",value:600,date_update:a},{name:"Bic Mac",value:b,date_update:""},{name:"Coca Cola (500ml)",value:h,date_update:a}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:"112",date_update:a},{name:"Policie",value:"117",date_update:a},{name:"Hasiči",value:n,date_update:a},{name:"Zdravotnická záchranná služba",value:n,date_update:a}],phone_prefix:"+245",coordinates:[{latitude:"11.8037",longitude:"-15.1804"}],people_religion:[{name:"Islám",value:"45%"},{name:"Animismus",value:"30%"},{name:"Křesťanství",value:"22%"},{name:"Jiné",value:f}],people_nationality:[{name:"Fula",value:"28%"},{name:"Balanta",value:"23%"},{name:"Mandinga",value:"14%"},{name:"Pepel",value:"9%"},{name:"Bijagó",value:"8%"},{name:"Mancanha",value:"4%"},{name:"Beafada",value:f},{name:"Jola",value:f},{name:"Jiliba",value:f},{name:"Susu",value:o},{name:"Nalu",value:g},{name:"Sarma",value:g},{name:"Nyminka",value:g},{name:"Aku",value:g},{name:"Ostatní",value:o}],visitors_entry:[{name:"Občanský průkaz",value:"Pro vstup do Guinea-Bissau je potřeba cestovního pasu, občanský průkaz nestačí.",date_update:a},{name:"Cestovní pas",value:"Pro vstup do Guinea-Bissau je nutné mít platný cestovní pas.",date_update:a},{name:"Vízum",value:"Pro vstup do Guinea-Bissau je nutné mít vízum. Občané České republiky mohou získat vízum při příjezdu na letišti v Bissau, pokud splní podmínky pro udělení víza (platný cestovní pas, zpáteční letenka, dostatečné finanční prostředky apod.). Je však doporučeno si předem ověřit aktuální podmínky pro vydání víza.",date_update:a},{name:"Očkování",value:"Při vstupu do Guinea-Bissau není nutné mít žádné povinné očkování. Doporučuje se očkování proti žluté zimnici a dalším nemocem jako jsou např. tyfus, hepatitida A a B, a meningokoková meningitida.",date_update:a},{name:"Cestovní pojištění",value:"Při vstupu do Guinea-Bissau není nutné mít cestovní ani zdravotní pojištění. Nicméně, doporučuje se mít pojištění, které pokryje náklady na lékařskou péči v zahraničí, včetně případného návratu do vlasti kvůli léčbě.",date_update:a},{name:"Bezpečností situace",value:"V Guinea-Bissau je vysoká kriminalita, zejména v Bissau a v některých dalších částech země. Je doporučeno být obezřetný a vyhnout se nočním procházkám v samotě. V posledních letech došlo k několika případům únosů a ozbrojených přepadení. Je třeba být opatrný při cestování po zemi a vyhýbat se nebezpečným oblastem. Před cestou je vhodné se informovat o aktuální bezpečnostní situaci v zemi.",date_update:a},{name:"Další informace",value:"V Guinea-Bissau je běžné místní obyvatelstvo oslovení \"senhor\" nebo \"senhora\" pro muže a ženy. Je vhodné dodržovat místní zvyklosti a respektovat místní kulturu. Dále je třeba dodržovat základní hygienické návyky, jako například mytí rukou, a dbát na to, co jíte a pijete. Měna v zemi je CFA frank západoafrického hospodářského a měnového společenství (XOF).",date_update:a}],type_place:p,id_image_cover:i,id_image_hero:i,id_city_main:898,affiliate:[{name:"booking",value:c}],mpz:"GW",alerts:b,zoom:[{google:7,booking:8}],ids_neighboring_countries:[{id:q},{id:205}],organization:b,apps:b,links:b,information_author:b,seo_tags:b,language_phrases:b,wall_sockets:b,id:q,facts_place:b,created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2024-03-02T11:05:26.667745+00:00",name_original:b,currency:[{code:"XOF",name:"frank CFA"}],setting_top:c}],imagePlace:[{id:i,name:l,source:"\u002Fworld\u002Fstates\u002F",type:p,author:"pixabay.com",created_at:"2023-05-02T18:49:47.851894+00:00",updated_at:"2023-12-27T20:42:18.520959+00:00"}],placeContinent:[{id:e,slug:"afrika",name:"Afrika",area:30370000,population:1340000000,population_density:44.12,number_states:54,information_chatgpt:"\u003Cp\u003EAfrika je největší kontinent na Zemi a rozkládá se na ploše přesahující 30 milionů kilometrů čtverečních. Nachází se zde více než 50 zemí a žije zde více než 1,3 miliardy lidí. \u003C\u002Fp\u003E\n\u003Cp\u003EJižní Afrika, Egypt, Maroko a Keňa patří mezi nejoblíbenější turistické cíle v Africe. V Jihoafrické republice se můžete podívat na slavné Krugerův národní park a sledovat zde život zvířat v jejich přirozeném prostředí. Egypt je zase proslulý svými pyramidami, které se nacházejí v Gíze. V Maroku můžete navštívit tradiční trhy, zatímco v Keni se můžete setkat s Masajským kmenem a podívat se na úžasnou přírodu.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má bohatou historii a kulturu. První lidé, kteří se usadili v Africe, byli loveckým a sběračským národem. Poté se v této oblasti objevily první civilizace, jako je Kúšská říše, Egyptská říše nebo Království Aksum. Afrika byla také kolonizována evropskými mocnostmi a toto období mělo značný dopad na dnešní politickou situaci na kontinentu.\u003C\u002Fp\u003E\n\u003Cp\u003EJe důležité zmínit, že Afrika má velké množství jazyků a kultur. Zahrnuje mnoho různých národů a etnických skupin, a to má vliv na různorodost obyvatelstva a kultury. Nejrozšířenějším jazykem je arabština, která se mluví především v severní Africe a v některých částech západní Afriky. Dalšími důležitými jazyky jsou svahilština, francouzština, portugalština, angličtina a mnoho dalších.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má také nádhernou přírodu. Nachází se zde nejvyšší hora světa, Kilimandžáro, která se nachází na území Tanzanie a Keňy. Kromě toho se v Africe nachází také největší pouště na světě, Sahara, a největší prales, Kongský prales. Na tomto kontinentě můžete vidět také mnoho zvířat, jako jsou sloni, lvi, gepardi, zebry a mnoho dalších druhů. V Africe se také nachází několik nejvýznamnějších řek světa, jako je Nil, Kongo, Niger a Zambezi.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je bohužel také známá pro své problémy. Mnoho zemí se potýká s chudobou, nedostatkem potravin a vody, nemocemi a válečnými konflikty. Mnoho afrických zemí závisí na zemědělství a rybolovu, což však často není dostatečně výnosné, aby zabezpečilo potřeby obyvatelstva. Kromě toho jsou některé země v Africe trvale postižené extrémními přírodními katastrofami, jako jsou sucha, povodně a bouře.\u003C\u002Fp\u003E\n\u003Cp\u003ENa druhou stranu se v Africe také nachází mnoho lidí, kteří se snaží změnit situaci a zlepšit životy svých spoluobčanů. Vznikají neziskové organizace, které se snaží pomáhat při řešení těchto problémů a zlepšovat kvalitu života v mnoha afrických zemích. Zároveň se v posledních letech objevují nové možnosti pro ekonomický růst a rozvoj, jako jsou technologické start-upy a zahraniční investice.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika je fascinující kontinent, který nabízí mnoho zážitků a zároveň v sobě ukrývá mnoho výzev. Pokud se rozhodnete navštívit Afriku, můžete se těšit na krásnou přírodu, bohatou kulturu a nezapomenutelné zážitky. Je však také důležité být obezřetný a připravený na místní podmínky, protože některé oblasti mohou být nebezpečné kvůli konfliktům nebo zločinnosti.\u003C\u002Fp\u003E",coordinates:[{latitude:1.650801,longitude:17.371642}],type_place:"continent",id_image_cover:e,id_image_hero:e,zoom:[{google:j,booking:3}],information_author:[{text:"\u003Cp\u003E\u003Cb\u003EAfrika\u003C\u002Fb\u003E, druhý největší a druhý nejlidnatější kontinent na světě, láká cestovatele svou neuvěřitelnou rozmanitostí kultur, přírodními krásami a bohatou historií. Při cestování touto obrovskou plochou se otevírá mozaika různorodých zážitků, které zahrnují odlesky moderního městského života, divokou přírodu až po historická místa.\u003C\u002Fp\u003E\u003Cp\u003EJižní Afrika, domov několika národních parků a rezervací, je rájem pro milovníky safari. \u003Cb\u003EKrugerův národní park (Kruger National Park)\u003C\u002Fb\u003E nabízí úžasné setkání s \"Velkým pětkou\" - slony, nosorožci, buvoly, lvy a levharty. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fcape-town\"\u003EKapské Město (Cape Town)\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s ikonickou horou \u003Cb\u003EMaclear's Beacon\u003C\u002Fb\u003E, poskytuje nezapomenutelný výhled na město a okolní krajinu.\u003C\u002Fp\u003E\u003Cp\u003EVýchodní Afrika je známá svými ohromujícími sopkami. \u003Cb\u003EKilimandžáro\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, nejvyšší hora Afriky, přitahuje dobrodruhy a horolezce z celého světa. Návštěva \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003EZanzibaru\u003C\u002Fa\u003E\u003C\u002Fb\u003E s jeho bílými plážemi a historickým centrem \u003Cb\u003EStone Town\u003C\u002Fb\u003E přidává do cestovatelského mixu kouzlo exotiky.\u003C\u002Fp\u003E\u003Cp\u003EStřední Afrika, s obrovskou rovníkovou pralesní plochou, skrývá některé z nejzajímavějších biodiverzit na světě. \u003Cb\u003EKonžský deštný prales\u003C\u002Fb\u003E je po amazonském druhý největší na světě, je domovem vzácných druhů zvířat a rostlin, a expedice sem mohou odhalit tajemství dosud neobjevená.\u003C\u002Fp\u003E\u003Cp\u003ESeverní Afrika je poznamenána starověkými civilizacemi a písečnými pouštěmi. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fegypt\"\u003EEgypt\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pyramidami a chrámy na březích \u003Cb\u003ENilu\u003C\u002Fb\u003E je jednou z nejnavštěvovanějších destinací v této části kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmaroko\"\u003EMaroko\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s mistrovským spojením tradice a moderny v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmarrakes\"\u003EMarrákeši\u003C\u002Fa\u003E\u003C\u002Fb\u003E, je fascinujícím mixem barev, vůní a architektury.\u003C\u002Fp\u003E\u003Cp\u003EZápadní Afrika, bohatá na kulturní dědictví, nabízí autentické zážitky. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fghana\"\u003EGhana\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pevnostmi, které připomínají období otroctví, a kultovními festivaly představuje hluboký pohled do minulosti. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fsenegal\"\u003ESenegal\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s historickým ostrovem \u003Cb\u003EGorée\u003C\u002Fb\u003E, který sehral roli s obchodem s otroky, kde najdete koloniální budovy a muzeum \u003Cb\u003EHouse of Slaves (Maison des esclaves)\u003C\u002Fb\u003E.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je rovněž známá svými divokými zvířaty. Kromě safari v jižní části kontinentu můžete zažít jedinečnou příležitost sledovat migraci tisíců zeber a gazel v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fkena\"\u003EKeni\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E. Návštěva gorilí v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Frwanda\"\u003ERwandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fuganda\"\u003EUgandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E je neopakovatelným zážitkem pro ty, kteří touží po setkání s těmito ohroženými tvory.\u003C\u002Fp\u003E\u003Cp\u003EPřírodní skvosty nejsou omezeny pouze na pevninskou část kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fseychely\"\u003ESeychely\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMauricius\u003C\u002Fa\u003E\u003C\u002Fb\u003E, dvě ostrůvky v \u003Cb\u003EIndickém oceánu\u003C\u002Fb\u003E, lákají svými bílými plážemi, průzračnými vodami a jedinečnou faunou a florou.\u003C\u002Fp\u003E\u003Cp\u003EAfrika rovněž hýří kulturou a historií. Starověké památky jako \u003Cb\u003EGreat Zimbabwe National Monument\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fzimbabwe\"\u003EZimbabwe\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003ETimbuktu (Tombouctou)\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMali\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou svědectvím o bohaté historii a rozvoji obchodu a kultury na africkém kontinentu. Každý region má své vlastní tradiční tance, hudbu a umění, které odrážejí místní identitu a historii.\u003C\u002Fp\u003E\u003Cp\u003ECestování Afrikou je také o interakci s místními lidmi. Přívětivost a pohostinnost afrických komunit jsou nezapomenutelnými součástmi cestování. Místní trhy nabízejí pestrou škálu barev, vůní a chutí, zatímco setkání s kmeny a etnickými skupinami přináší pochopení různorodosti kultur a tradic.\u003C\u002Fp\u003E\u003Cp\u003EJe však důležité si být vědomý sociálních, ekonomických a environmentálních výzev, kterým mnohé africké země čelí. Cestovatelé by měli být respektující vůči místním zvyklostem a životnímu prostředí a přispívat k udržitelnému turismu, který podporuje místní ekonomiky a ochranu přírodních zdrojů.\u003C\u002Fp\u003E\u003Cp\u003ECelkově lze říci, že cestování po Africe je dobrodružstvím naplněným kontrasty a překvapeními. Od rozlehlých savan po exotické pláže, od starověkých ruin po moderní metropole. Afrika nabízí cestovatelům nekonečné možnosti objevování a poznávání. Je to kontinent, který zanechává nezapomenutelný dojem na každém, kdo se odhodlá k jeho prozkoumání.\u003C\u002Fp\u003E",date_create:r,date_update:r,author_create:s,author_update:s}],seo_tags:[],created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2024-03-02T11:45:40.694514+00:00",name_original:"Africa",setting_top:c}]}],fetch:{},mutations:[]}}("05-2023",null,true,0,5,"3%","1%",500,263,2,1,"guinea-bissau",250,"119","2%","state",93,"2024-03-01","1")));